import React from 'react';
import * as icons from 'react-icons/fa';
import * as api from '../library/api';
import * as ultility from '../library/ultility';

class Navbar extends React.PureComponent {
    constructor(props) {
        super(props)
        this.state = {
            open: true,
        }
    }

    ToggleMobileNavbar = () => {
        this.setState({ open: !this.state.open });
        this.props.isOpen(this.state.open);
    }

    componentDidMount = () => {
        this.ToggleMobileNavbar()
    }

    Logout = () => {
        api.Post("/Logout/", null, function (response) {
            if (response) {
                ultility.DeleteCookie("user");
                window.location.href = '/Login'
            }
        });
    }

    render() {
        return (
            <>
                <nav className="navbar navbar-expand-lg">
                    <div className="container-fluid d-flex align-items-center justify-content-between">
                        <div className="">
                            <i className={this.state.open ? "burger open" : "burger"} onClick={this.ToggleMobileNavbar}>
                                <span></span>
                                <span></span>
                                <span></span>
                            </i>
                        </div>
                        <div className="navbar-header">
                        </div>
                        <div className="dropdown show">
                            <a className="dropdown-toggle" href="/#" role="button" id="dropdownMenuLink" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                                <icons.FaCog /> <icons.FaCaretDown />
                            </a>
                            <div className="dropdown-menu" aria-labelledby="dropdownMenuLink">
                                <Link className="dropdown-item" to="/Account">Account <i><icons.FaUser /></i></Link>
                                <a className="dropdown-item" href="/#" onClick={this.Logout}>Logout <i><icons.FaSignOutAlt /></i></a>
                            </div>
                        </div>
                    </div>
                </nav>
            </>
        );
    }
}

export default Navbar;
